import React, {useEffect} from 'react';
import "./navbar.css";
import Logo from "../../assets/img/logo-navbar.png"
import { NavLink } from 'react-router-dom';


const Navbar = () => {
    const isAuth = useSelector(state => state.user.isAuth) 
    const dispatch = useDispatch()
    useEffect(() => {
      dispatch(auth())
    }, [])
    return (
        <div className="navbar">
            <div className="container">
                <img src={Logo} alt = {""}  className="navbar__logo"/>
                <div className="navbar__register"><NavLink to="/registration">  Registration </NavLink> </div>
                <div className="navbar__login"><NavLink to="/login">  Login </NavLink> </div>
                {isAuth && <Link id="navbar__item" onClick={() => dispatch(logout())}> Logout</Link> }  
            </div>
        </div>
    );
};

export default Navbar;
